import React from 'react';
import ReactDOM from 'react-dom';

class FightButton extends React.Component {
  render() {
    return (
        <><Topbar /><div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#f0f0f0' }}>
            <button style={{ fontSize: '28px', padding: '15px 25px', backgroundColor: '#ff4500', color: '#fff', borderRadius: '10px', border: 'none', cursor: 'pointer' }}>Fight</button>
        </div></>
    );
  }
}

ReactDOM.render(
  <FightButton />,
  document.getElementById('root')
);
